import styled from "styled-components";

const Style = styled.div`
.head {
    .headTitle {
        text-transform: uppercase;
        font-family: "Poppins", sans-serif;
        font-weight: 500;
        line-height: 24px;
        color: black;
    }
}
`;

export default Style;
